        "cellValue": "1、脱硫：浮选系统运行正常，当前进料185m3/h；打散装置间断运行。\n2、溶出：现Ⅰ组闪蒸Nt105、106乏汽带料，调整中；机组注氧量：Ⅱ组400Kg/h,Ⅲ组300Kg/h，Ⅳ组200Kg/h；2日机组总进料31467m³，平均进料1311m³/h；当前精液量1680m³/h。\n3、蒸发：2#排盐过滤机运行；化片碱（当日/月累计）：168t/667t。\n4、主体设备运行情况：①1#沉降槽清理，1#后槽检修；②Rp209槽化清；③赤泥12台压滤机运行，4辆车倒运，平均80车/班；④侧流苛化、赤泥脱碱继续带料运行。\n5、日计划进矿量5500吨（低硫矿5200吨，高硫矿300吨），实际进矿量5311吨(低硫矿4668吨，高硫矿643吨)，日生产用矿:8689吨（低硫矿7310吨，高硫矿1379吨）。\n6、铝灰熟料消耗量：消耗（当日/月累计）：0t/0t。\n7、现场管理、视频监控及工艺纪律检查：5000元，其中  ①、氧化铝厂1000元 ；②、电解铝厂1000元；③分析计控中心1000元； ④合金事业部500元；⑤、投资管理部500元；⑥、营销中心1000元。",
