        "cellValue": "1、1月3日计划出铝1172吨，外销可发365吨，合金锭65吨，内铸暂定742吨。\n2、1月2日内铸铝液389.34吨，完成铸造铝锭387.062吨。\n3、1月2日铝液Fe/Si：200KA系列0.163/0.074(提质槽0.881/0.457,不含提质槽0.111/0.043)；350KA系列0.1/0.04，公司加权含提质槽0.117/0.05，不含提质槽0.103/0.041。\n4、主体设备运行情况：①2810#刨槽；1101#吊出上部槽。 ②电解一厂房:2#天车调整激光防撞装置距离。电解三厂房:2#天车处理抓斗不能旋转。电解四厂房:5#天车更换下料机构插板阀销轴轴承。电解六厂房:临时故障检修焊补2807#.2814#槽大车行走轨道裂缝处，紧固周边轨道压板螺栓。③21:50 350铸造新铸机翻转器故障，3日0:20处理好，3:00再次故障，投用3#铸机生产。",
